import logo from '../../components/Logo.png';
import s from './Header.module.css'
const Header = ()=>{
    return(
<header>
  <div className={s.header}>
  <div><span>оставить заявку</span></div>
   <div><img src={logo}></img></div>
  </div>
</header>
    );
};

export default Header;
